export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},fgpHcja0hw:{data:{id:1488,attributes:{imdbId:"tt0036930",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BY2ZmNDVhNTYtNjIzNy00MWQxLWI0M2UtOTc3OWIyNjAzYTk3XkEyXkFqcGdeQXVyNDY1NzU5NjY@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"}],item_lang:{data:{id:2151,attributes:{title:g,plot:"A beautiful Austrian refugee in England--who is also a Nazi agent--marries a scholarly English pacifist. He lives near a secret military base she needs to get information about so she can help in Hitler's planned invasion of England.",slug:"the-hour-before-the-dawn"}}},books:{data:[{id:7885,attributes:{title:g,description:"\"The Hour Before the Dawn\" by W. Somerset Maugham. Published by Good Press. Good Press publishes a wide range of titles that encompasses every genre. From well-known classics & literary fiction and non-fiction to forgotten−or yet undiscovered gems−of world literature, we issue the books that need to be read. Each Good Press edition has been meticulously edited and formatted to boost readability for all e-readers and devices. Our goal is to produce eBooks that are user-friendly and accessible to everyone in a high-quality digital format.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zmZBEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"2021-08-31",publisher:"Good Press",subtitle:a}},{id:7886,attributes:{title:"Leben und Werk",description:"Klaus W. Jonas' zweisprachige Ausgabe behandelt die literarische Laufbahn des Schriftstellers W. Somerset Maugham (1874-1965), eines der erfolgreichsten und meistgelesenen englischen Dramatiker, Essayisten und Romanciers der ersten Halfte des 20. Jahrhunderts. Maugham selbst hat das humorvolle Vorwort in der Form eines Briefes beigesteuert. Eine chronologische Darstellung seines Lebens wird erganzt durch zwei wissenschaftliche Essays des Verfassers zu Maughams umfassendem literarischen Schaffen. Von besonderem Interesse sind die Auszuge aus dem Briefwechsel zwischen Klaus W. Jonas und W. Somerset Maugham, die einen genaueren Einblick in die Personlichkeit des Schriftstellers erlauben und von der engen Vertrautheit der beiden Briefpartner zeugen. Den zweiten Teil der Ausgabe bilden eine ausfuhrliche Bibliographie von Maughams literarischem Schaffen sowie eine Auswahlbibliographie von mehr als 420 kritischen Studien in deutscher, englischer, japanischer, spanischer und franzosischer Sprache. 71 Abbildungen, viele von ihnen bisher unveroffentlicht und aus Privatbesitz, erhohen den dokumentarischen Wert dieses Bandes. In this bilingual edition the author attempts to trace the literary career of William Somerset Maugham (1874-1865), one of the most widely read and performed dramatists, essayists and novelists in English literature in the first half of the twentieth century. Maugham himself has contributed a humorous preface in the form of a letter addressed to the author. The detailed chronology of Maugham's life is being supplemented by two of the author's numerous essays dealing with the stupendous literary oeuvre of this writer. Of special interest are the excerpts from Maugham's letters to his German-born collector and biographer which provide an inside view into his personality and his friendship with Klaus W. Jonas. The second half of this volume contains a bibliographical record of Maugham's life-work and a select bibliography of 420 critical studies in German, English, French, Spanish and Japanese. 71 illustrations, many of which hitherto unpublished and privately owned, enhance the documentary value of this volume.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dV5BeXacNxQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Klaus W. Jonas"],firstBook:d,published:"2009-01-01",publisher:"Otto Harrassowitz Verlag",subtitle:a}},{id:7887,attributes:{title:"The Essential W. Somerset Maugham Collection",description:"Compiled in one book, the essential collection of books by W. Somerset Maugham The Explorer The Hero The Land of Promise The Land of The Blessed Virgin; Sketches and Impressions in Andalusia Liza of Lambeth The Magician Moon and Sixpence Of Human Bondage Orientations The Trembling of a Leaf",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7rEU54YhH5MC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2013-03-07",publisher:h,subtitle:a}},{id:7888,attributes:{title:"Quartet",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=l-Qynk3dyc4C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"1949-01-01",publisher:a,subtitle:a}},{id:7889,attributes:{title:"Catalina",description:"When a sixteen-year-old Spanish girl sees a religious vision while praying in a convent, she becomes involved in a series of humorous adventures. Catalina is a crippled girl, supposedly cured by divine intervention after witnessing a vision of the Virgin Mary. As a result of this, she is pressured into becoming a nun in a Carmelite convent. The Bishop of Segovia, himself undergoing a crisis of faith, becomes involved in the debate about the debt owed to god by Catalina for her cure, but the girl resists all attempts to control her life, determined to marry the man she loves. She joins a troupe of strolling players and becomes the most famous actress in all of Spain.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=y9wXEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2021-01-29",publisher:h,subtitle:a}}]}}},meta:{}}},prerenderedAt:1682568480283}}("","movie","W. Somerset Maugham",null,"series",1,"The Hour Before the Dawn","eBookIt.com"))